ices to public management.’</p> \r\n  <blockquote>\r\n‘Just this month, the Mayor of Paris announced that the city would be returning services to public management from 2009. France - arguably the heartland of privatised water services - is at the forefront of the remunicipalisation trend that is also manifesting itself in parts of South America, North America and Africa. Increased tariffs and a failure to deliver on promised improvements have left water multinationals facing increasing opposition from local communities and politicians. Some have taken steps to end contracts with private operators. Others are considering doing so. The remunicipalisation tracker (www.remunicipalisation.org) provides case studies from these communities - giving details of the problems faced and the victories won.’\r\n</blockquote>\";s:7:\"summary\";s:514:\"<p> </p>\r\n  <p>Water privatization has been high on the globalisation agenda over the last years. But privatizers haven’t necessarily found it easy to get their way, thanks to vibrant campaigns by local residents, trade unionists and environmental and social justice activists. Campaigns against water privatization have been so successful – and privatization experiements so disastrous – that a trend towards de-privatization of water services has been gathering a head of steam.&nbsp;</p> \r\n  <p>&nbsp;</p>\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1561:\"<p>Water privatization has been high on the globalisation agenda over the last years. But privatizers haven’t necessarily found it easy to get their way, thanks to vibrant campaigns by local residents, trade unionists and environmental and social justice activists. Campaigns against water privatization have been so successful – and privatization experiements so disastrous – that a trend towards de-privatization of water services has been gathering a head of steam. </p>\n<p>  Now, a new website, brought to you by my old friends at Corporate Europe Observatory (CEO) and the Transnational Institute: ‘highlights the growing trend to return failing privately managed water services to public management.’ </p>\n<blockquote><p>\n‘Just this month, the Mayor of Paris announced that the city would be returning services to public management from 2009. France - arguably the heartland of privatised water services - is at the forefront of the remunicipalisation trend that is also manifesting itself in parts of South America, North America and Africa. Increased tariffs and a failure to deliver on promised improvements have left water multinationals facing increasing opposition from local communities and politicians. Some have taken steps to end contracts with private operators. Others are considering doing so. The remunicipalisation tracker (<a href=\"http://www.remunicipalisation.org\">www.remunicipalisation.org</a>) provides case studies from these communities - giving details of the problems faced and the victories won.’\n</p></blockquote>\n\";s:12:\"safe_summary\";s:492:\"<p>Water privatization has been high on the globalisation agenda over the last years. But privatizers haven’t necessarily found it easy to get their way, thanks to vibrant campaigns by local residents, trade unionists and environmental and social justice activists. Campaigns against water privatization have been so successful – and privatization experiements so disastrous – that a trend towards de-privatization of water services has been gathering a head of steam. <br />\n   </p>\n\";}}}s:19:\"field_related_media\";a:0:{}s:17:\"field_newint_tags\";a:1:{s:3:\"und\";a:2:{i:0;a:1:{s:3:\"tid\";s:3:\"615\";}i:1;a:1:{s:3:\"tid\";s:3:\"674\";}}}s:18:\"field_contributors\";a:0:{}s:11:\"rdf_mapping\";a:9:{s:7:\"rdftype\";a:2:{i:0;s:9:\"sioc:Item\";i:1;s:13:\"foaf:Document\";}s:5:\"title\";a:1:{s:10:\"predicates\";a:1:{i:0;s:8:\"dc:title\";}}s:7:\"created\";a:3:{s:10:\"predicates\";a:2:{i:0;s:7:\"dc:date\";i:1;s:10:\"dc:created\";}s:8:\"datatype\";s:12:\"xsd:dateTime\";s:8:\"c