ks to vibrant campaigns by local residents, trade unionists and environmental and social justice activists. Campaigns against water privatization have been so successful – and privatization experiements so disastrous – that a trend towards de-privatization of water services has been gathering a head of steam.</p> \r\n  <p> </p> \r\n  <p>Now, a new website, brought to you by my old friends at Corporate Europe Observatory (CEO) and the Transnational Institute: ‘highlights the growing trend to return failing privately managed water services to public management.’</p> \r\n  <blockquote>\r\n‘Just this month, the Mayor of Paris announced that the city would be returning services to public management from 2009. France - arguably the heartland of privatised water services - is at the forefront of the remunicipalisation trend that is also manifesting itself in parts of South America, North America and Africa. Increased tariffs and a failure to deliver on promised improvements have left water multinationals facing increasing opposition from local communities and politicians. Some have taken steps to end contracts with private operators. Others are considering doing so. The remunicipalisation tracker (www.remunicipalisation.org) provides case studies from these communities - giving details of the problems faced and the victories won.’\r\n</blockquote>\";s:5:\"#rows\";i:20;s:11:\"#attributes\";a:1:{s:5:\"class\";a:1:{i:0;s:9:\"text-full\";}}s:7:\"#format\";s:13:\"filtered_html\";s:10:\"#base_type\";s:8:\"textarea\";s:7:\"summary\";a:10:{s:5:\"#type\";s:8:\"textarea\";s:14:\"#default_value\";s:514:\"<p> </p>\r\n  <p>Water privatization has been high on the globalisation agenda over the last years. But privatizers haven’t necessarily found it easy to get their way, thanks to vibrant campaigns by local residents, trade unionists and environmental and social justice activists. Campaigns against water privatization have been so successful – and privatization experiements so disastrous – that a trend towards de-privatization of water services has been gathering a head of steam.&nbsp;</p> \r\n  <p>&nbsp;</p>\";s:6:\"#title\";s:7:\"Summary\";s:5:\"#rows\";i:5;s:12:\"#description\";s:61:\"Leave blank to use trimmed value of full text as the summary.\";s:9:\"#attached\";a:1:{s:2:\"js\";a:1:{i:0;s:34:\"modules/field/modules/text/text.js\";}}s:11:\"#attributes\";a:1:{s:5:\"class\";a:1:{i:0;s:12:\"text-summary\";}}s:7:\"#prefix\";s:34:\"<div class=\"text-summary-wrapper\">\";s:7:\"#suffix\";s:6:\"</div>\";s:7:\"#weight\";i:-10;}}s:6:\"#theme\";s:25:\"field_multiple_value_form\";s:11:\"#field_name\";s:4:\"body\";s:12:\"#cardinality\";s:1:\"1\";s:6:\"#title\";s:4:\"Body\";s:9:\"#required\";b:0;s:12:\"#description\";s:0:\"\";s:7:\"#prefix\";s:32:\"<div id=\"body-add-more-wrapper\">\";s:7:\"#suffix\";s:6:\"</div>\";s:10:\"#max_delta\";i:0;s:12:\"#after_build\";a:1:{i:0;s:30:\"field_form_element_after_build\";}s:9:\"#language\";s:3:\"und\";s:14:\"#field_parents\";a:0:{}}s:7:\"#access\";b:1;}s:19:\"field_related_media\";a:7:{s:5:\"#type\";s:9:\"container\";s:11:\"#attributes\";a:1:{s:5:\"class\";a:3:{i:0;s:16:\"field-type-image\";i:1;s:30:\"field-name-field-related-media\";i:2;s:24:\"field-widget-image-image\";}}s:7:\"#weight\";i:-3;s:5:\"#tree\";b:1;s:9:\"#language\";s:3:\"und\";s:3:\"und\";a:5:{i:0;a:19:{s:7:\"#entity\";r:35;s:12:\"#entity_type\";s:4:\"node\";s:7:\"#bundle\";s:4:\"blog\";s:11:\"#field_name\";s:19:\"field_related_media\";s:9:\"#language\";s:3:\"und\";s:14:\"#field_parents\";a:0:{}s:8:\"#columns\";a:5:{i:0;s:3:\"fid\";i:1;s:3:\"alt\";i:2;s:5:\"title\";i:3;s:5:\"width\";i:4;s:6:\"height\";}s:6:\"#title\";s:13:\"Related Media\";s:12:\"#description\";s:106:\"Files must be less than <strong>2 MB</strong>.<br />Allowed file types: <strong>png gif jpg jpeg</strong>.\";s:9:\"#required\";b:0;s:6:\"#delta\";i:0;s:5:\"#type\";s:12:\"managed_file\";s:16:\"#upload_location\";s:9:\"public://\";s:18:\"#upload_validators\";a:2:{s:18:\"file_validate_size\"